import {useState} from 'react';


const App = () => {
    const [count, setCount] = useState(0);

    return (
        <div>
        Count: {count}
        <button
            onClick={() => setCount(count + 1)}
        >
            Increase
        </button>
        </div>
    );
};

export default App;
